import {
  Text,
  View,
  TextInput,
  StyleSheet,
  SafeAreaView,
} from "react-native";

const NewSession = () => {
  return (
    <SafeAreaView>
      <View>
        <Text>New Session</Text>
        <View>Title</View>
        <TextInput style={styles.codeTextBox}> Title</TextInput>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  codeTextBox: {
    borderWidth: 1,
    borderColor: "black",
    borderRadius: 5,
    padding: 5,
    width: 200,
  },
});

export default NewSession;
